svg.script:

    function init(evt)
    {
        if ( window.svgDocument == null )
        {
            svgDocument = evt.target.ownerDocument;
        }
    }
  var prisonerTurns  = [42,55,61,73,92,124,149,154,171,174,178,185,191,232,242,248];
  var prisonerStones = [[25],[46],[42],[68],[31],[115],[40],[121],[154],[171],[117],[180],[176],[169],[231, 239],[247]];
  var prisonersBlack = 0;
  var prisonersWhite = 0;
  var num_moves = 251;

var current_move = 0;
var stoneNumbersVisible = 0;

function nextMove(evt)
{
    current_move++;
    if (current_move > num_moves)
    {
        current_move--;
        return;
    }

    stone = svgDocument.getElementById("stone"+current_move); 
    toggleStoneVisibility(current_move, 'visible');

    var p = prisonerTurns.indexOf(current_move);
    if (p != -1)
    {
        if (stone.getAttributeNS(null, "class") == 'black-stone')
        {
            prisonersBlack += prisonerStones[p].length;
            svgDocument.getElementById("black-prisoners").firstChild.data = "Black prisoners: " + prisonersBlack;
        }
        else
        {
            prisonersWhite += prisonerStones[p].length;
            svgDocument.getElementById("white-prisoners").firstChild.data = "White prisoners: " + prisonersWhite;
        }

        for (var stone=0; stone<prisonerStones[p].length; stone++)
        {
            toggleStoneVisibility(prisonerStones[p][stone], 'hidden');
        }
    }

    stone_mark = svgDocument.getElementById("stone_mark");
    stone_mark.setAttributeNS(null, "visibility", "visible");
    stone_mark.setAttributeNS(null, "x", stone.getAttributeNS(null, "cx")-3);
    stone_mark.setAttributeNS(null, "y", stone.getAttributeNS(null, "cy")-3);

    if (stone.getAttributeNS(null, "class") == 'white-stone')
    {
        stone_mark.setAttributeNS(null, "style", "fill:black;");
    }
    else
    {
        stone_mark.setAttributeNS(null, "style", "fill:white;");
    }

}

function prevMove(evt)
{
    toggleStoneVisibility(current_move, 'hidden');
    svgDocument.getElementById("stone_mark").setAttributeNS(null, "visibility", "hidden");

    var p = prisonerTurns.indexOf(current_move);
    if (p != -1)
    {
        for (var stone=0; stone<prisonerStones[p].length; stone++)
        {
            toggleStoneVisibility(prisonerStones[p][stone], 'visible');
        }
    }

    current_move--;
}

function toggleStoneVisibility(stone_id, visibility)
{
    svgDocument.getElementById("stone"  + stone_id).setAttributeNS(null, "visibility", visibility);
    if (stoneNumbersVisible == 1)
    {
        svgDocument.getElementById("number" + stone_id).setAttributeNS(null, "visibility", visibility);
    }
}

function toggleStoneNumbers(evt)
{
    if (stoneNumbersVisible == 0)
    {
        stoneNumbersVisible = 1;
        visibility = 'visible';
    }
    else
    {
        stoneNumbersVisible = 0;
        visibility = 'hidden';
    }

    for (var i=1; i<=current_move; i++)
    {
        if (svgDocument.getElementById("stone"+i).getAttributeNS(null, "visibility") == 'visible')
        {
            svgDocument.getElementById("number"+i).setAttributeNS(null, "visibility", visibility);
        }
    }
}
